css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
/* タブの読み込み中アイコンをフォクすけ化 (loading icon on tab)*/
.tab-throbber {
    list-style-image: url("data:image/gif;base64,") !important;
}

/* 特に指定のないタブアイコンをフォクすけ化（読み込み中じゃないとき）(Unless site-specific icons to Foxkeh) */
.tabbrowser-tab:not([busy]):not([progress]) .tab-icon-image/*[[changefavicon]]*/{
    -moz-margin-end: 3px;
    width: 16px;
    height: 16px;
    background: url("data:image/png;base64,") ;
}

/* マウスのせるとフォクすけ (MouseOver Tab) */
.tabbrowser-tab:hover .tab-icon-image{
    background: url("data:image/gif;base64,") !important;
}

/* faviconを変更 (Change favicon) */
.tab-icon-image/*[[changefavicon]]*/ ,.tabbrowser-tab:hover .tab-icon-image{
    -moz-padding-start:16px !important;
}

/* firefoxのアップデートで追加されたCSSを無効化する */
.tab-icon-image:not([src]){
  display:block!important;
}
